const int MAP_LENGTH = 100;
const int MAP_HEIGHT = 100;
const int HALF_LENGTH = MAP_LENGTH / 2;
const int HALF_HEIGHT = MAP_HEIGHT / 2;
const int N = MAP_HEIGHT * MAP_LENGTH;
const int n = HALF_LENGTH * HALF_HEIGHT;


struct point {
	int start, end;
	bool operator==(const point &B) const{
		if ((start == B.start) && (end == B.end)) { return true; }
		return false;
	}

	bool operator<(const point& B) const {
		if ((start < B.start)) { return true; }
		if (start == B.start) { if (end < B.end) { return true; } }
		return false;
	}

	bool operator>(const point& B) const {
		if ((start > B.start)) { return true; }
		if (start == B.start) { if (end > B.end) { return true; } }
		return false;
	}
};

struct node {
	point pos;
	int number;
};

struct HMapstruct { int map[N]; };

bool contains(int* L, int e, int len, int delta = 0) {
	for (int i = 0; i < len; i++) {
		if (*(L + i) == e) { return true; }
	}
	return false;
}


std::list<std::list<node>> create_nodes() {
	//std::cout << "create nodes" << std::endl;

	std::list<std::list<node>> nodes;
	//node nodes[HALF_LENGTH][HALF_HEIGHT];

	for (int x = 0; x < HALF_LENGTH; x++) {
		std::list<node> temp;
		for (int y = 0; y < HALF_HEIGHT; y++) {
			node tn;
			tn.pos.start = x * 2 + 1;
			tn.pos.end = y * 2 + 1;
			tn.number = x + y * HALF_LENGTH;
			temp.push_back(tn);
		}
		nodes.push_back(temp);
	}
	return nodes;
}

std::list<int*> create_edges() {
	//std::cout << "create edges" << std::endl;

	std::list<int*> edges;

	int skiplist[HALF_LENGTH];
	for (int i = 0; i < HALF_LENGTH; i++) {
		skiplist[i] = HALF_LENGTH * i;
	}

	for (int x = 0; x < n; x++) {
		int temp[n];
		for (int y = 0; y < n; y++) {
			if (x != y) {
				if ((x + 1 == y) && (!contains(skiplist, y, HALF_LENGTH))) { temp[y] = (rand() % 3) + 1; }
				else { if (x + HALF_LENGTH == y) { temp[y] = (rand() % 3) + 1; } }
			}
		}
		edges.push_back(temp);
	}


	return edges;
}

//Check if list contains v1
bool containsl(std::list<int> list, int e) {
	for (int x : list) {
		if (x == e) { return true; }
	}
	return false;
}

bool containslpoint(std::list<point> list, point p) {
	for (point x : list) {
		if (x == p) { return true; }
		//if ((x.start == p.start) && (x.end == p.end)) { return true; }
	}
	return false;
}

int readl(std::list<int> list, int index) {
	std::list<int>::iterator it = list.begin();
	for (int i = 0; i < index; i++) {
		++it;
	}
	return *it;
}

int* readlintpoint(std::list<int*> list, int index) {
	std::list<int*>::iterator it = list.begin();
	for (int i = 0; i < index; i++) {
		++it;
	}
	return  *it;
}


std::list<node> prims_algo() {//std::list<int *> edges) {
	//std::cout << "prim algo" << std::endl;
	//node* clean_edges = (node*)malloc(n * n);
	std::list<node> clean_edges;
	//std::list<int*> edges;

	int skiplist[HALF_LENGTH];
	for (int i = 0; i < HALF_LENGTH; i++) {
		skiplist[i] = HALF_LENGTH * i;
		//std::cout << skiplist[i] << " ";
	}
	//std::cout << " skiplist end" << std::endl;
	std::list<std::list<int>> edges;
	for (int x = 0; x < n; x++) {
		std::list<int> temp;
		for (int y = 0; y < n; y++) {

			if (x != y) {
				//std::cout << contains(skiplist, y, HALF_LENGTH) << " pour y=" << y << std::endl;
				if ((x + 1 == y) && (!contains(skiplist, y, HALF_LENGTH))) { temp.push_back((rand() % 3) + 1); }
				else {
					if (x + HALF_LENGTH == y) { temp.push_back((rand() % 3) + 1); }
					else { temp.push_back(0); }
				}

			}
			else { temp.push_back(0); }
		}
		edges.push_back(temp);
	}


	//std::cout << edges.size() << "edges " << std::endl;
	//for (std::list<int> edg : edges) {
	//	for (int k : edg) { std::cout << k << " "; }
		//std::cout << std::endl << std::endl;
	//}
	//std::cout << std::endl;

	int x = 0;
	int y = 0;
	for (std::list<int> L : edges) {

		for (int edge : L) {
			if (edge != 0) {
				node p{
					point{x,y},
					edge
				};
				clean_edges.push_back(p);
			}
			y++;
		}
		x++;
		y = 0;
	}

	//std::cout << clean_edges.size() << " clean edges " << std::endl;

	for (node edg : clean_edges) {
		//std::cout << edg.pos.start << " " << edg.pos.end << " | ";
	}
	//std::cout << std::endl;;

	//std::list<int> visited;
	std::set<int> visited;
	std::list<int> unvisited;
	for (int i = 0; i < n; i++) { unvisited.push_back(i); }
	int curr = 0;
	std::list<node> final_edges;
	//std::cout << "prim algo while" << std::endl;
	int init = unvisited.size();
	while (unvisited.size() > 0) {
		std::cout << unvisited.size() << " left on " << init << std::endl;
		visited.insert(curr);

		std::list<int> temp2;
		for (int number : unvisited) {
			if (visited.count(number)) { temp2.push_back(number); }
		}

		for (int toremove : temp2) { unvisited.remove(toremove); }

		std::list<node> my_edges;
		for (node edge : clean_edges) {

			bool b1 = visited.count(edge.pos.start);
			bool b2 = visited.count(edge.pos.end);
			if ((b1 || b2) && !(b1 && b2)) {
				my_edges.push_back(edge);
			}
		}

		node min_edge{
			point{-1,-1},
			N
		};

		for (node edge : my_edges) {
			if (edge.number < min_edge.number) {
				min_edge.number = edge.number;
				min_edge.pos.start = edge.pos.start;
				min_edge.pos.end = edge.pos.end;
			}
		}
		if (unvisited.size() == 0) { break; }

		final_edges.push_back(min_edge);

		if (min_edge.pos.start == -1) { curr = readl(unvisited, 0); }
		else {
			if (visited.count(min_edge.pos.end)) { curr = min_edge.pos.start; }
			else { curr = min_edge.pos.end; }
		}

	}
	return final_edges;
}

std::list<point> hamiltonian_cycle(std::list<std::list<node>> nodesl, std::list<node> edges) {
	//std::cout << "hamiltonian cycle" << std::endl;
	//std::cout << edges.size() << std::endl;
	std::list<point> cycle;
	//std::list<point> points;
	std::set<point> points;
	for (node edge : edges) {
		//std::cout << "edge " << edge.pos.start << " " << edge.pos.end << " " << edge.number << std::endl;

		point start = point{ 0,0 };
		point end = point{ 0,0 };
		for (std::list<node> L : nodesl) {
			for (node nod : L) {

				if (nod.number == edge.pos.start) {
					start.start = nod.pos.start; start.end = nod.pos.end;
				}
				if (nod.number == edge.pos.end) {
					end.start = nod.pos.start; end.end = nod.pos.end;
				}
			}
		}

		points.insert(start);
		points.insert(point{ (start.start + end.start) / 2,(start.end + end.end) / 2 });
		points.insert(end);
	}
	//std::cout << points.size() << std::endl;


	point curr = point{ 6,6 }; //INIT pos
	cycle.push_back(curr);
	point dir = point{ 1,0 }; //INIT dir
	//std::cout << "hamiltonian cycle while" << std::endl;

	while (cycle.size() < N) {
		std::cout << cycle.size() << " over " << N << std::endl;

		int x = curr.start;
		int y = curr.end;
		//right
		if ((dir.start == 1) && (dir.end == 0)) {
			if ((points.count(point{ x + 1, y + 1 })
				&& (!points.count(point{ x + 1,y })))) {
				curr.start = x + 1;
				curr.end = y;
			}
			else {
				if ((points.count(point{ x, y + 1 })
					&& (!(points.count(point{ x + 1,y + 1 }))))) {
					dir.start = 0;
					dir.end = 1;
				}
				else {
					dir.start = 0;
					dir.end = -1;
				}
			}
		}
		//down
		else if ((dir.start == 0) && (dir.end == 1)) {
			if ((points.count(point{ x, y + 1 })
				&& (!points.count(point{ x + 1,y + 1 })))) {
				curr.start = x;
				curr.end = y + 1;
			}
			else {
				if ((points.count(point{ x, y + 1 })
					&& (points.count(point{ x + 1,y + 1 })))) {
					dir.start = 1;
					dir.end = 0;
				}
				else {
					dir.start = -1;
					dir.end = 0;
				}
			}
		}
		//left
		else if ((dir.start == -1) && (dir.end == 0)) {
			if ((points.count(point{ x, y })
				&& (!points.count(point{ x,y + 1 })))) {
				curr.start = x - 1;
				curr.end = y;;
			}
			else {
				if (!points.count(point{ x, y + 1 })) {
					dir.start = 0;
					dir.end = -1;
				}
				else {
					dir.start = 0;
					dir.end = 1;
				}
			}
		}
		//up
		else if ((dir.start == 0) && (dir.end == -1)) {
			if ((!points.count(point{ x, y })
				&& (points.count(point{ x + 1,y })))) {
				curr.start = x;
				curr.end = y - 1;
			}
			else {
				if (points.count(point{ x + 1, y })) {
					dir.start = -1;
					dir.end = 0;
				}
				else {
					dir.start = 1;
					dir.end = 0;
				}
			}
		}

		if (!containslpoint(cycle, curr)) {
			cycle.push_back(curr);
		}
	}
	return cycle;
}



